import { FORMS } from "..";
export var FormTypes;
(function (FormTypes) {
    FormTypes["SUBMIT_CART"] = "SUBMIT_CART";
    FormTypes["NEW_FOLDER"] = "NEW_FOLDER";
    FormTypes["NEW_BOX"] = "NEW_BOX";
    FormTypes["none"] = "none";
})(FormTypes || (FormTypes = {}));
var FormStore = (function () {
    function FormStore(formType, user) {
        var _this = this;
        Object.assign(this, FORMS[formType]);
        this.onSubmit = function (e) {
            _this.submit(e, user);
        };
    }
    return FormStore;
}());
export { FormStore };
